import React from 'react';
import postsStyle from './Posts.module.css';

function Posts() {
  return (
    <div className={postsStyle.post}>
        <img src="../../img/profilephoto.jpeg"/>
        <p>{this.props.text}</p>
    </div>
  );
}

export default Posts;
